using System.Linq;\n\nclass Person\n{\n    public string CompositeKey { get; set; }\n}\n\nclass Exclusion\n{\n    public string CompositeKey { get; set; }\n}\n\npublic List<Person> FilterPeople(List<Person> people, List<Exclusion> exclusions)\n{\n    var exclusionKeys = exclusions.Select(e => e.CompositeKey).ToHashSet();\n    return people.Where(p => !exclusionKeys.Contains(p.CompositeKey)).ToList();\n}